"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony import */ var react__WEBPACK_IMPORTED_MODULE_0__ = __webpack_require__(/*! react */ \"(ssr)/./node_modules/next/dist/server/route-modules/app-page/vendored/ssr/react.js\");\n/* harmony import */ var react__WEBPACK_IMPORTED_MODULE_0___default = /*#__PURE__*/__webpack_require__.n(react__WEBPACK_IMPORTED_MODULE_0__);\n\nconst HidroterapiaNeonatosContent = `\n  <div class=\"prose max-w-none\">\n    <h2 class=\"text-3xl font-bold text-[#4A96D1] mb-6\">Hidroterapia em Neonatos: Recreando o Ambiente Intrauterino</h2>\n    \n    <div class=\"bg-blue-50 p-6 rounded-xl mb-8\">\n      <h3 class=\"text-xl text-[#4A96D1] mb-4 font-semibold\">Introdução à Hidroterapia Neonatal</h3>\n      <p class=\"text-gray-700\">\n        A hidroterapia para neonatos é uma abordagem terapêutica que utiliza as propriedades físicas da água para promover \n        relaxamento, estimulação sensorial e motora em recém-nascidos, especialmente prematuros. Esta técnica recria um \n        ambiente semelhante ao intrauterino, proporcionando uma experiência familiar que favorece o desenvolvimento \n        neuromotor, reduz o estresse e promove o bem-estar do bebê durante sua internação na Unidade de Terapia Intensiva \n        Neonatal (UTIN).\n      </p>\n    </div>\n\n    <div class=\"jsx-13131a25edb8b7e9 px-4 py-3 bg-[#F0F9FF] border-b border-[#E0E0E0] overflow-x-auto\">\n      <div class=\"jsx-13131a25edb8b7e9 flex items-center space-x-4 min-w-max\">\n        <a href=\"#principios-da-hidroterapia\" class=\"jsx-13131a25edb8b7e9 text-sm font-medium px-3 py-1.5 rounded-full bg-white text-[#4A96D1] hover:bg-[#4A96D1] hover:text-white transition-colors shadow-sm whitespace-nowrap\">Princípios</a>\n        <a href=\"#tecnicas-de-hidroterapia\" class=\"jsx-13131a25edb8b7e9 text-sm font-medium px-3 py-1.5 rounded-full bg-white text-[#4A96D1] hover:bg-[#4A96D1] hover:text-white transition-colors shadow-sm whitespace-nowrap\">Técnicas</a>\n        <a href=\"#indicacoes-e-contraindicacoes\" class=\"jsx-13131a25edb8b7e9 text-sm font-medium px-3 py-1.5 rounded-full bg-white text-[#4A96D1] hover:bg-[#4A96D1] hover:text-white transition-colors shadow-sm whitespace-nowrap\">Indicações</a>\n        <a href=\"#beneficios-comprovados\" class=\"jsx-13131a25edb8b7e9 text-sm font-medium px-3 py-1.5 rounded-full bg-white text-[#4A96D1] hover:bg-[#4A96D1] hover:text-white transition-colors shadow-sm whitespace-nowrap\">Benefícios</a>\n        <a href=\"#consideracoes-finais\" class=\"jsx-13131a25edb8b7e9 text-sm font-medium px-3 py-1.5 rounded-full bg-white text-[#4A96D1] hover:bg-[#4A96D1] hover:text-white transition-colors shadow-sm whitespace-nowrap\">Considerações Finais</a>\n      </div>\n    </div>\n\n    <div class=\"my-10\">\n      <div class=\"relative h-[350px] md:h-[450px] lg:h-[500px] w-full rounded-xl overflow-hidden shadow-md mb-4 bg-gray-50 flex items-center justify-center p-4\">\n        <img src=\"/images/neonatal/hidroterapia-neonatal.jpg\" alt=\"Bebê prematuro recebendo hidroterapia em banheira específica\" class=\"max-h-full max-w-full object-contain\" style=\"object-fit: contain;\" />\n      </div>\n      <p class=\"text-sm text-center text-gray-600 italic\">Figura 1: Sessão de hidroterapia com bebê prematuro em banheira terapêutica adaptada</p>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\" id=\"principios-da-hidroterapia\">Princípios da Hidroterapia Neonatal</h3>\n    \n    <div class=\"grid grid-cols-1 md:grid-cols-3 gap-6 mt-6 mb-8\">\n      <div class=\"bg-white rounded-xl shadow-sm hover:shadow-md transition-all duration-300 overflow-hidden border border-gray-100\">\n        <div class=\"bg-gradient-to-r from-[#4A96D1]/10 to-[#6EC1E4]/5 p-3 border-b border-gray-100\">\n          <h4 class=\"text-[#4A96D1] font-semibold text-lg\">Efeitos Fisiológicos</h4>\n        </div>\n        <div class=\"p-4\">\n          <p class=\"text-gray-700 text-sm\">A imersão em água aquecida produz relaxamento muscular, estimula a circulação sanguínea e proporciona alívio da dor, contribuindo para a estabilidade dos sinais vitais.</p>\n        </div>\n      </div>\n\n      <div class=\"bg-white rounded-xl shadow-sm hover:shadow-md transition-all duration-300 overflow-hidden border border-gray-100\">\n        <div class=\"bg-gradient-to-r from-[#4A96D1]/10 to-[#6EC1E4]/5 p-3 border-b border-gray-100\">\n          <h4 class=\"text-[#4A96D1] font-semibold text-lg\">Estimulação Sensorial</h4>\n        </div>\n        <div class=\"p-4\">\n          <p class=\"text-gray-700 text-sm\">O ambiente aquático proporciona estímulos sensoriais variados (táteis, proprioceptivos, vestibulares) que favorecem o desenvolvimento neurológico e a organização sensorial.</p>\n        </div>\n      </div>\n\n      <div class=\"bg-white rounded-xl shadow-sm hover:shadow-md transition-all duration-300 overflow-hidden border border-gray-100\">\n        <div class=\"bg-gradient-to-r from-[#4A96D1]/10 to-[#6EC1E4]/5 p-3 border-b border-gray-100\">\n          <h4 class=\"text-[#4A96D1] font-semibold text-lg\">Desenvolvimento Motor</h4>\n        </div>\n        <div class=\"p-4\">\n          <p class=\"text-gray-700 text-sm\">A flutuação e a resistência da água facilitam movimentos que seriam difíceis fora dela, promovendo experiências motoras positivas e favorecendo o desenvolvimento de padrões motores adequados.</p>\n        </div>\n      </div>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\" id=\"tecnicas-de-hidroterapia\">Técnicas de Hidroterapia em Neonatologia</h3>\n    <p class=\"text-gray-700 mb-6\">\n      A hidroterapia em neonatologia engloba diferentes técnicas adaptadas às necessidades específicas de cada bebê, \n      respeitando sua idade gestacional, condição clínica e desenvolvimento neurológico:\n    </p>\n\n\n    <div class=\"space-y-6 mt-8\">\n      <div class=\"bg-white p-5 rounded-xl shadow-sm hover:shadow-md transition-all duration-300 border border-gray-100\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Ofurô Terapêutico</h4>\n        <p class=\"text-gray-700\">\n          Consiste na imersão parcial do bebê em água aquecida (aproximadamente 37°C), em banheiras adaptadas que \n          permitem manter o neonato em posição fetal, simulando o ambiente uterino. A técnica proporciona relaxamento \n          global, redução do estresse e melhora da qualidade do sono. É realizada por curtos períodos (5-10 minutos), \n          com monitoramento constante dos sinais vitais.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-5 rounded-xl shadow-sm hover:shadow-md transition-all duration-300 border border-gray-100\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Watsu Adaptado</h4>\n        <p class=\"text-gray-700\">\n          Adaptação da técnica de Watsu para neonatos, que combina elementos de flutuação, alongamentos suaves e \n          movimentos rítmicos na água. O bebê é sustentado pelo terapeuta, que realiza movimentos lentos e fluidos, \n          promovendo relaxamento profundo e estimulando os sistemas vestibular e proprioceptivo.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-5 rounded-xl shadow-sm hover:shadow-md transition-all duration-300 border border-gray-100\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Envelopamento Úmido</h4>\n        <p class=\"text-gray-700\">\n          Técnica que utiliza tecidos macios umedecidos com água morna para envolver o bebê, criando uma sensação de \n          contenção similar ao ambiente intrauterino. Promove organização sensorial, redução da agitação e melhora \n          do padrão de sono. É especialmente útil para bebês que não podem ser totalmente imersos na água.\n        </p>\n      </div>\n    </div>\n\n    <div class=\"my-10\">\n      <div class=\"relative h-[350px] md:h-[450px] lg:h-[500px] w-full rounded-xl overflow-hidden shadow-md mb-4 bg-gray-50 flex items-center justify-center p-4\">\n        <img src=\"/images/neonatal/tecnicas-hidroterapia.jpg\" alt=\"Diferentes técnicas de hidroterapia aplicadas em neonatos\" class=\"max-h-full max-w-full object-contain\" style=\"object-fit: contain;\" />\n      </div>\n      <p class=\"text-sm text-center text-gray-600 italic\">Figura 2: Comparação entre diferentes técnicas de hidroterapia utilizadas em UTINs</p>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\" id=\"indicacoes-e-contraindicacoes\">Indicações e Contraindicações</h3>\n    \n    <div class=\"grid grid-cols-1 md:grid-cols-2 gap-6 mt-6 mb-8\">\n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Indicações</h4>\n        <ul class=\"text-gray-700 text-sm space-y-2\">\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Prematuridade estável (após 32 semanas de idade corrigida)</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Hipertonia ou hipotonia muscular</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Desorganização sensorial</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Dificuldades no padrão de sono</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Estresse e irritabilidade</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Dor crônica ou pós-procedimentos</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Constipação intestinal</span>\n          </li>\n        </ul>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Contraindicações</h4>\n        <ul class=\"text-gray-700 text-sm space-y-2\">\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Instabilidade clínica ou hemodinâmica</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Prematuridade extrema (< 30 semanas)</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Lesões cutâneas extensas ou infecções</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Procedimentos cirúrgicos recentes</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Cateteres ou dispositivos que não possam ser molhados</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Convulsões não controladas</span>\n          </li>\n          <li class=\"flex items-start\">\n            <span class=\"text-[#6EC1E4] mr-2\">•</span>\n            <span>Cardiopatias graves descompensadas</span>\n          </li>\n        </ul>\n      </div>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\">Protocolos de Aplicação</h3>\n    <p class=\"text-gray-700 mb-6\">\n      A implementação da hidroterapia em neonatos requer protocolos específicos, com atenção especial às medidas de segurança \n      e ao monitoramento das respostas fisiológicas do bebê. Geralmente, os procedimentos seguem estas etapas:\n    </p>\n    \n    <div class=\"grid grid-cols-1 md:grid-cols-2 gap-6 mt-6 mb-8\">\n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Avaliação Pré-procedimento</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Verificação dos sinais vitais, análise da estabilidade clínica, avaliação da idade gestacional corrigida \n          e discussão com a equipe multidisciplinar para determinar a melhor abordagem.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Preparação do Ambiente</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Controle da temperatura ambiente (24-26°C), preparação da água (37°C), desinfecção da banheira e organização \n          dos materiais necessários (toalhas, termômetro, monitor de sinais vitais).\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Realização do Procedimento</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Imersão gradual, manutenção da posição de contenção (simulando posição fetal), aplicação de técnicas \n          específicas com duração de 5-10 minutos, monitoramento contínuo dos sinais vitais e das respostas comportamentais.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Avaliação Pós-procedimento</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Secagem cuidadosa, monitoramento dos sinais vitais, avaliação do comportamento pós-intervenção, \n          registro das respostas obtidas e planejamento da próxima sessão.\n        </p>\n      </div>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\" id=\"beneficios-comprovados\">Benefícios Comprovados</h3>\n    <p class=\"text-gray-700 mb-4\">\n      Estudos científicos têm documentado diversos benefícios da hidroterapia em neonatos, especialmente em prematuros:\n    </p>\n\n    <div class=\"space-y-4 mb-8\">\n      <div class=\"flex items-start bg-[#F0F9FF] p-4 rounded-lg\">\n        <span class=\"text-[#4A96D1] font-bold mr-3 mt-0.5\">•</span>\n        <p class=\"text-gray-700\"><span class=\"font-semibold text-[#4A96D1]\">Estabilização dos Sinais Vitais:</span> Redução da frequência cardíaca e respiratória, melhora da saturação de oxigênio e estabilização da temperatura corporal.</p>\n      </div>\n      \n      <div class=\"flex items-start bg-[#F0F9FF] p-4 rounded-lg\">\n        <span class=\"text-[#4A96D1] font-bold mr-3 mt-0.5\">•</span>\n        <p class=\"text-gray-700\"><span class=\"font-semibold text-[#4A96D1]\">Redução do Estresse:</span> Diminuição dos níveis de cortisol e comportamentos indicativos de estresse, com melhora da qualidade do sono e dos estados comportamentais.</p>\n      </div>\n      \n      <div class=\"flex items-start bg-[#F0F9FF] p-4 rounded-lg\">\n        <span class=\"text-[#4A96D1] font-bold mr-3 mt-0.5\">•</span>\n        <p class=\"text-gray-700\"><span class=\"font-semibold text-[#4A96D1]\">Alívio da Dor:</span> Efeito analgésico durante e após procedimentos dolorosos, com redução de escores em escalas de avaliação da dor neonatal.</p>\n      </div>\n      \n      <div class=\"flex items-start bg-[#F0F9FF] p-4 rounded-lg\">\n        <span class=\"text-[#4A96D1] font-bold mr-3 mt-0.5\">•</span>\n        <p class=\"text-gray-700\"><span class=\"font-semibold text-[#4A96D1]\">Regulação do Tônus Muscular:</span> Normalização do tônus em bebês com hipertonia ou hipotonia, facilitando posturas e movimentos mais funcionais.</p>\n      </div>\n      \n      <div class=\"flex items-start bg-[#F0F9FF] p-4 rounded-lg\">\n        <span class=\"text-[#4A96D1] font-bold mr-3 mt-0.5\">•</span>\n        <p class=\"text-gray-700\"><span class=\"font-semibold text-[#4A96D1]\">Ganho de Peso:</span> Alguns estudos indicam que bebês submetidos regularmente à hidroterapia apresentam melhor ganho de peso e redução do tempo de internação.</p>\n      </div>\n\n      <div class=\"flex items-start bg-[#F0F9FF] p-4 rounded-lg\">\n        <span class=\"text-[#4A96D1] font-bold mr-3 mt-0.5\">•</span>\n        <p class=\"text-gray-700\"><span class=\"font-semibold text-[#4A96D1]\">Melhor Desenvolvimento Neuromotor:</span> Acompanhamento a longo prazo sugere melhor desenvolvimento neuromotor em bebês que receberam hidroterapia durante a internação na UTIN.</p>\n      </div>\n    </div>\n\n    <div class=\"my-10\">\n      <div class=\"relative h-[350px] md:h-[450px] lg:h-[500px] w-full rounded-xl overflow-hidden shadow-md mb-4 bg-gray-50 flex items-center justify-center p-4\">\n        <img src=\"/images/neonatal/beneficios-hidroterapia.jpg\" alt=\"Gráfico demonstrando os benefícios da hidroterapia em neonatos\" class=\"max-h-full max-w-full object-contain\" style=\"object-fit: contain;\" />\n      </div>\n      <p class=\"text-sm text-center text-gray-600 italic\">Figura 3: Comparação de parâmetros fisiológicos antes e após a hidroterapia em neonatos prematuros</p>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\">Implementação na UTIN</h3>\n    <p class=\"text-gray-700 mb-4\">\n      A integração da hidroterapia como parte do cuidado desenvolvimentista em UTINs requer a colaboração de uma equipe \n      multidisciplinar e a adequação do ambiente físico. Alguns aspectos importantes para a implementação incluem:\n    </p>\n\n    <div class=\"grid grid-cols-1 md:grid-cols-2 gap-6 mt-6 mb-8\">\n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Capacitação da Equipe</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Treinamento específico para fisioterapeutas e outros profissionais da equipe na aplicação das técnicas de \n          hidroterapia neonatal, com ênfase na segurança e no manejo do recém-nascido prematuro.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Adaptação do Ambiente</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Criação de espaço adequado, com controle de temperatura, baixa luminosidade e redução de ruídos, \n          para a realização dos procedimentos de hidroterapia na própria UTIN.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Protocolos Institucionais</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Desenvolvimento de protocolos de avaliação, aplicação e monitoramento específicos para a instituição, \n          considerando os recursos disponíveis e as características da população atendida.\n        </p>\n      </div>\n      \n      <div class=\"bg-white p-4 rounded-lg shadow-sm hover:shadow-md transition-all duration-300\">\n        <h4 class=\"text-[#4A96D1] font-semibold text-lg mb-2\">Envolvimento Familiar</h4>\n        <p class=\"text-gray-700 text-sm\">\n          Inclusão dos pais nos procedimentos de hidroterapia, quando possível, como parte do cuidado \n          centrado na família, fortalecendo o vínculo e promovendo a continuidade dos cuidados após a alta.\n        </p>\n      </div>\n    </div>\n\n    <h3 class=\"text-2xl text-[#6EC1E4] mt-10 mb-4 font-semibold\" id=\"consideracoes-finais\">Considerações Finais</h3>\n    <p class=\"text-gray-700 mb-4\">\n      A hidroterapia representa uma abordagem promissora no cuidado desenvolvimentista de neonatos prematuros, \n      oferecendo benefícios significativos para seu bem-estar físico e emocional durante a internação na UTIN. \n      A simulação do ambiente intrauterino proporcionada pela água aquecida cria uma experiência familiar e \n      reconfortante, facilitando a transição para o ambiente extrauterino.\n    </p>\n    \n    <p class=\"text-gray-700 mb-6\">\n      No entanto, é importante ressaltar que a hidroterapia deve ser parte de um programa abrangente de cuidados, \n      em conjunto com outras intervenções desenvolvimentistas, como o Método Canguru, posicionamento terapêutico e \n      controle de estímulos ambientais. Sua aplicação requer avaliação individualizada e constante monitoramento, \n      respeitando as limitações de cada bebê e adaptando as técnicas às suas necessidades específicas.\n    </p>\n\n    <div class=\"my-8 p-6 bg-[#F0F9FF] border border-[#E0E0E0] rounded-xl shadow-sm\">\n      <h3 class=\"text-xl font-semibold text-[#4A96D1] mb-4\">Pontos-chave sobre Hidroterapia em Neonatos</h3>\n      <ul class=\"space-y-2\">\n        <li class=\"flex items-start\">\n          <span class=\"text-[#6EC1E4] mr-2\">•</span>\n          <span class=\"text-gray-700\">A hidroterapia recria o ambiente intrauterino, proporcionando uma experiência sensorial familiar para o recém-nascido</span>\n        </li>\n        <li class=\"flex items-start\">\n          <span class=\"text-[#6EC1E4] mr-2\">•</span>\n          <span class=\"text-gray-700\">Técnicas como ofurô terapêutico e envelopamento úmido são adaptadas às necessidades específicas de cada bebê</span>\n        </li>\n        <li class=\"flex items-start\">\n          <span class=\"text-[#6EC1E4] mr-2\">•</span>\n          <span class=\"text-gray-700\">Benefícios incluem estabilização dos sinais vitais, redução do estresse, alívio da dor e melhor regulação do tônus muscular</span>\n        </li>\n        <li class=\"flex items-start\">\n          <span class=\"text-[#6EC1E4] mr-2\">•</span>\n          <span class=\"text-gray-700\">A implementação requer capacitação da equipe, adaptação do ambiente e desenvolvimento de protocolos específicos</span>\n        </li>\n        <li class=\"flex items-start\">\n          <span class=\"text-[#6EC1E4] mr-2\">•</span>\n          <span class=\"text-gray-700\">Estudos científicos fundamentam sua eficácia como parte do cuidado desenvolvimentista em UTINs</span>\n        </li>\n      </ul>\n    </div>\n  </div>\n`;\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (HidroterapiaNeonatosContent);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./app/data/hidroterapia-neonatos-content.tsx\n");

